import React from 'react';
import '../css/Header.css';

const Header = () => {
    return (
        <header className="bg-blue-600 text-white p-4 flex justify-between items-center">
            <h1 className="text-2xl font-bold">Mi Página</h1>
            <div>
                <button className="mx-2 bg-white text-blue-600 font-semibold py-1 px-4 rounded">Iniciar Sesión</button>
                <button className="mx-2 bg-white text-blue-600 font-semibold py-1 px-4 rounded">Registrarse</button>
            </div>
        </header>
    );
};

export default Header;
